import React from "react";

const DIsplayItem = ({ ticket }) => {
  let numList = [];
  const getdigits = (num) => {
    let li = [];
    let temp = num;
    while (temp > 0) {
      li = [temp % 10, ...li];
      temp = Math.floor(temp / 10);
    }
  };

  numList = getdigits(ticket);

  return (
    <div>
      <div className="digitFlex">
        {numList.map((digit) => {
          return <p>{digit}</p>;
        })}
      </div>
    </div>
  );
};
export default DIsplayItem;
